<head>
  <meta charset="utf-8">
  <meta name="viewport" content="width=device-width, initial-scale=1">
  <title>{{ meta.report_title }}{{ meta.report_subtitle }}</title>
  <style>
    {{ html_assets['bootstrap-5.3.3.min.css'] }}
  </style>
  <style>
    :root {
      --muted-color: #BEBEBE;
    }
    body {
      min-height: 75rem;
      padding-top: 4.5rem;
      background: #FAFAFA;
      font-style: normal;
      font-family: 'Roboto', sans-serif;
    }
    .muted-text {
      font-size: normal;
      color: var(--muted-color);
    }
  </style>
  <script>{{ html_assets['bootstrap-5.3.3.bundle.min.js'] }}</script>
  <script>{{ html_assets['plotly-2.12.1.min.js'] }}</script>
  <style>
    .navbar {
      background: linear-gradient(90deg, #3D4FFF 0%, #788FFF 37.22%, #24DB96 63.03%, #C7FF00 100%) !important;
    }
    .navbar .nav-link {
      color: #FFFFFF !important;
      font-family: 'objectivity', sans-serif !important;
    }
    .navbar-brand {
      background: #FFFFFF !important;
      border-radius: 4px !important;
      color: #000000 !important;
      font-family: 'objectivity', sans-serif !important;
      font-style: normal;
      font-weight: 400;
      font-size: 16px !important;
      padding: 1px 7px;
    }
    #summary {
      font-family: 'objectivity', sans-serif;
      font-weight: 700;
    }

    #summary span {
      background: #C7FF00 !important;
      border-radius: 6px;
      display: inline-block;
      padding: 5px 6px 7px;
    }
    .generation-date {
      margin-bottom: 40px;
      font-family: 'Roboto', sans-serif;
      margin-top: 15px;
      font-style: normal;
      font-weight: 400;
      font-size: 16px;
      line-height: 24px;
    }
    .generation-date a {
      color: #424DB3;
      text-decoration: none;
    }
    .generation-date a:hover {
      text-decoration: underline;
    }

    .white-box {
      background: #FFFFFF;
      border: 1px solid #D3D3D3;
      border-radius: 16px;
    }

    .result-box {
      padding: 23px;
    }
    .result-box .table {
      margin-bottom: 0;
    }
    .result-box table td {
      border-bottom: 0;
      padding: 0;
    }
    .result-box table td:nth-child(3) > table tr:not(:last-child) td:first-child {
      padding-bottom: 10px;
    }
    .result-box table td:nth-child(3) > table td:last-child {
      padding-left: 13px;
    }
    /* used by bootstrap to manipulate tooltip */
    .tooltip {
      --bs-tooltip-max-width: 400px;
      --bs-tooltip-padding-x: 10px;
      --bs-tooltip-padding-y: 10px;
      --bs-tooltip-bg: rgba(66, 77, 179, 1.0);
      --bs-tooltip-font-size: 14px;
    }
    .tooltip-inner {
      line-height: 22px;
      vertical-align: top;
      text-align: left;
      color: #fff;
      font-style: normal;
      font-family: Roboto, sans-serif;
    }
    .result-box .result-box-title {
      font-style: normal;
      font-weight: 400;
      font-size: 16px;
      line-height: 24px;
      letter-spacing: -0.015em;
      color: #595959;
      font-family: 'objectivity', sans-serif;
      display: flex;
      align-items: flex-start;
      gap: 6px;
    }
    .result-box .result-box-large-title {
      padding-top: 7px;
      font-style: normal;
      font-weight: 400;
      font-size: 32px;
      line-height: 38px;
      letter-spacing: -0.0199px;
      color: rgba(0, 0, 0, 0.85);
    }
    .result-box .result-box-big-icon {
      padding-top: 17px;
      text-align: center;
    }
    .result-box .result-box-big-icon div {
      display: inline-block;
    }
    .result-box .result-box-separator {
      background: rgba(0, 0, 0, 0.07);
      width: 1px;
      height: 107px;
      margin-left: 20px;
      margin-right: 20px;
    }
    .result-box:last-child {
      margin-right: 0;
    }

    #distances {
      padding-top: 10px;
      font-style: normal;
      font-weight: 700;
      font-size: 32px;
      line-height: 42px;
      color: rgba(0, 0, 0, 0.85);
      margin-bottom: 30px;
      font-family: 'objectivity', sans-serif;
    }

    .explainer {
      padding-bottom: 6px;
      margin-bottom: 90px;
    }

    .explainer .explainer-header {
      display: flex;
      align-items: center;
      padding-bottom: 42px;
    }

    .explainer .explainer-icon {
      width: 42px;
      margin-left: -40px;
      margin-right: 21px;
    }

    .explainer .explainer-title {
      font-style: normal;
      font-weight: 500;
      font-size: 26px;
      line-height: 24px;
      color: #27BBA6;
      font-family: 'objectivity', sans-serif;
    }

    .explainer .explainer-body {
      padding: 17px 22px;
      position: relative;
    }

    .explainer .explainer-body::before {
      content: ' ';
      position: absolute;
      width: 38px;
      left: -6px;
      height: calc(100% + 12px);
      top: -6px;
      border-top: 6px solid #000000;
      border-left: 6px solid #000000;
      border-bottom: 6px solid #000000;
    }
    .explainer .explainer-body::after {
      content: ' ';
      position: absolute;
      width: 38px;
      right: -6px;
      height: calc(100% + 12px);
      top: -6px;
      border-top: 6px solid #000000;
      border-right: 6px solid #000000;
      border-bottom: 6px solid #000000;
    }

    #accuracy {
      padding-top: 10px;
      font-style: normal;
      font-weight: 700;
      font-size: 32px;
      line-height: 42px;
      color: rgba(0, 0, 0, 0.85);
      margin-bottom: 38px;
      font-family: 'objectivity', sans-serif;
    }

    .charts-section-title {
      font-style: normal;
      font-weight: 700;
      font-size: 32px;
      line-height: 42px;
      color: rgba(0, 0, 0, 0.85);
      margin-bottom: 30px;
      padding-top: 10px;
      font-family: 'objectivity', sans-serif;
    }

    .anchor {
      padding-top: 80px !important;
      margin-top: -80px !important;
    }

    .footer {
      display: block;
      width: 100%;
      height: 46px;
      background: #C7FF00;
    }
